/*Table structure for table `policy` */

DROP TABLE IF EXISTS `policy`;

CREATE TABLE `policy` (
  `ID` bigint NOT NULL,
  `NAME` varchar(225) DEFAULT NULL,
  `SUM_ASSURED` varchar(225) DEFAULT NULL,
  `PREMIUM` varchar(225) DEFAULT NULL,
  `TENURE` varchar(225) DEFAULT NULL,
  `DESCRIPTION` varchar(225) DEFAULT NULL,
  `CATEGORY_ID` bigint DEFAULT NULL,
  `CATEGORY_NAME` varchar(225) DEFAULT NULL,
  `SUB_CATEGORY_ID` bigint DEFAULT NULL,
  `SUB_CATEGORY_NAME` varchar(225) DEFAULT NULL,
  `IMAGE` longblob,
  `CREATED_BY` varchar(225) DEFAULT NULL,
  `MODIFIED_BY` varchar(225) DEFAULT NULL,
  `CREATED_DATETIME` timestamp NULL DEFAULT NULL,
  `MODIFIED_DATETIME` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `CATEGORY_ID` (`CATEGORY_ID`),
  KEY `SUB_CATEGORY_ID` (`SUB_CATEGORY_ID`),
  CONSTRAINT `policy_ibfk_1` FOREIGN KEY (`CATEGORY_ID`) REFERENCES `category` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `policy_ibfk_2` FOREIGN KEY (`SUB_CATEGORY_ID`) REFERENCES `subcategory` (`ID`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci;

